import uniqid from 'uniqid'
const SkillItems = [
    {id: uniqid(), name: 'Ruby', img: "https://cdn.jsdelivr.net/gh/devicons/devicon/icons/ruby/ruby-original.svg"},
]

export default SkillItems;
